import React from 'react';
import { Link } from "react-router-dom";

const Header = (props) => {
    return (
        
        <div className="row">
            <Link to={'/'}>
                <div className="col-12 Header justify-content-center justify-content-around my-4 d-flex m-0">
                    <p className="text-white">Dulces</p>
                    <p className="text-white">Meriendas </p>
                </div>
            </Link>
        </div>
    )

}
export default Header;
